import React, { Component } from 'react';
import '../App.css';
import {
    BrowserRouter as Router,
    Link
  } from "react-router-dom"; 

class Header extends Component {
    render() {
        return(
            <div className="Header">
                <ul className="menu">
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/">New</Link>
                    </li>
                    <li>
                        <Link to="/">Men</Link>
                    </li>
                    <li>
                        <Link to="/">Women</Link>
                    </li>
                    <li>
                        <Link to="/">Children</Link>
                    </li>
                </ul>
            </div>
        )
    }
}
export default Header;
